import React from "react"
import {LinkContainer} from 'react-router'

class Item extends React.Component{
  render() {
    return (
      <div>
        <LinkContainer to= {this.props.url}><li>{this.props.title}</li></LinkContainer>
      </div>
    )
  }
}
export default Item
